eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst knowledgeBase = [\n    {\n        \"id\": \"cbt_intro_01\",\n        \"content\": \"Cognitive Behavioral Therapy (CBT) is a structured, goal-oriented form of psychotherapy. It focuses on the interconnectedness of thoughts (cognitions), feelings (emotions), and behaviors. The core principle of CBT is that our thoughts, rather than external events, are the primary drivers of our feelings and actions. By identifying and changing distorted or unhelpful thinking patterns, individuals can change their emotional responses and behaviors.\"\n    },\n    {\n        \"id\": \"cbt_distortions_01\",\n        \"content\": \"A key concept in CBT is the identification of 'cognitive distortions' or 'thinking errors.' These are irrational, biased ways of thinking that fuel negative emotions. Common distortions include All-or-Nothing Thinking (viewing things in absolute, black-and-white terms), Catastrophizing (assuming the worst-case scenario will happen), and Personalization (blaming oneself for events that are not entirely one's fault).\"\n    },\n    {\n        \"id\": \"cbt_thought_record_01\",\n        \"content\": \"The Thought Record is a fundamental tool in CBT. It is a structured worksheet that guides a person to identify a triggering situation, the automatic negative thoughts (ANTs) that arise, the emotions felt, the cognitive distortions at play, evidence that supports and refutes the ANT, and finally, a more balanced, alternative thought. This process trains the brain to challenge and restructure negative thought patterns over time.\"\n    },\n    {\n        \"id\": \"gad_symptoms_01\",\n        \"content\": \"Generalized Anxiety Disorder (GAD) is characterized by persistent and excessive worry about a variety of different things. People with GAD may anticipate disaster and may be overly concerned about money, health, family, work, or other issues. Individuals with GAD find it difficult to control their worry. They may worry more than seems warranted about actual events or may expect the worst even when there is no apparent reason for concern.\"\n    },\n    {\n        \"id\": \"gad_physical_symptoms_01\",\n        \"content\": \"The constant worry associated with Generalized Anxiety Disorder often manifests in physical symptoms. These can include fatigue, muscle tension or muscle aches, trembling, feeling twitchy, being easily startled, trouble sleeping, sweating, nausea, diarrhea, or irritable bowel syndrome.\"\n    },\n    {\n        \"id\": \"panic_attack_definition_01\",\n        \"content\": \"A panic attack is a sudden episode of intense fear that triggers severe physical reactions when there is no real danger or apparent cause. Panic attacks can be very frightening. When panic attacks occur, you might think you're losing control, having a heart attack, or even dying.\"\n    },\n    {\n        \"id\": \"panic_attack_symptoms_01\",\n        \"content\": \"Symptoms of a panic attack often peak within minutes and can include a sense of impending doom or danger, fear of loss of control or death, rapid, pounding heart rate (palpitations), sweating, trembling or shaking, shortness of breath or tightness in your throat, chills, hot flashes, nausea, and chest pain.\"\n    },\n    {\n        \"id\": \"grounding_intro_01\",\n        \"content\": \"Grounding techniques are coping strategies that help reconnect you with the present moment. They are particularly useful during panic attacks, flashbacks, or moments of intense anxiety or dissociation. Grounding works by turning your focus away from distressing internal thoughts and feelings and toward the external world as perceived through your senses.\"\n    },\n    {\n        \"id\": \"grounding_54321_01\",\n        \"content\": \"The 5-4-3-2-1 Grounding Technique is a simple yet powerful method to anchor yourself in the present. It involves systematically engaging your five senses. First, acknowledge FIVE things you see around you. Second, acknowledge FOUR things you can touch. Third, acknowledge THREE things you can hear. Fourth, acknowledge TWO things you can smell. Finally, acknowledge ONE thing you can taste.\"\n    },\n    {\n        \"id\": \"grounding_physical_01\",\n        \"content\": \"Physical grounding techniques involve using your body to connect with the present. Examples include digging your heels into the floor, noticing the sensation of your back against a chair, clenching and unclenching your fists while focusing on the changing tension, or holding a piece of ice and focusing on the intense cold sensation.\"\n    },\n    {\n        \"id\": \"diaphragmatic_breathing_01\",\n        \"content\": \"Diaphragmatic breathing, also known as belly breathing, is a technique that helps to fully engage the diaphragm and increase the efficiency of the lungs. It is a cornerstone of relaxation and can activate the parasympathetic nervous system, which promotes a state of calm. This type of breathing is characterized by the expansion of the abdomen rather than the chest during inhalation.\"\n    },\n    {\n        \"id\": \"diaphragmatic_breathing_technique_01\",\n        \"content\": \"To practice diaphragmatic breathing, sit or lie in a comfortable position. Place one hand on your upper chest and the other on your belly. Breathe in slowly through your nose for a count of four, feeling your belly rise as you inhale. The hand on your chest should remain relatively still. Exhale slowly through your mouth for a count of six, feeling your belly fall. Making the exhale longer than the inhale is key to relaxation.\"\n    },\n    {\n        \"id\": \"pmr_intro_01\",\n        \"content\": \"Progressive Muscle Relaxation (PMR) is a deep relaxation technique based on the simple practice of tensing one muscle group at a time, holding the tension for a few seconds, and then releasing it. This process helps you become more aware of physical tension in your body and provides a method for consciously releasing it, which can significantly reduce anxiety and improve sleep.\"\n    },\n    {\n        \"id\": \"pmr_technique_01\",\n        \"content\": \"A typical Progressive Muscle Relaxation sequence involves starting with the muscles in the feet and progressively working your way up the body. For each muscle group (e.g., feet, lower legs, thighs, hands, arms, shoulders, face), you should tense the muscles for 5-10 seconds without straining, and then abruptly release the tension. Rest for 20-30 seconds, noticing the difference between the feeling of tension and relaxation, before moving to the next muscle group.\"\n    },\n    {\n        \"id\": \"mindfulness_intro_01\",\n        \"content\": \"Mindfulness is the practice of maintaining a non-judgmental state of heightened or complete awareness of one's thoughts, emotions, or experiences on a moment-to-moment basis. It is about paying attention on purpose, in the present moment, without getting carried away by judgments about 'good' or 'bad' experiences.\"\n    },\n    {\n        \"id\": \"mindful_observation_01\",\n        \"content\": \"Mindful observation involves choosing an object in your environment and focusing on it for a minute or two. The goal is to notice every aspect of the object as if you are seeing it for the first time. Observe its colors, shape, texture, and the way light reflects off it. This simple practice trains the mind to focus and stay in the present.\"\n    },\n    {\n        \"id\": \"social_anxiety_01\",\n        \"content\": \"Social Anxiety Disorder (SAD), also known as social phobia, involves an intense fear of social situations. This fear stems from a worry about being judged, scrutinized, or negatively evaluated by others. It is more than just shyness; it can be debilitating and significantly impact daily life, work, and relationships. Physical symptoms can include blushing, sweating, and trembling.\"\n    },\n    {\n        \"id\": \"exposure_therapy_01\",\n        \"content\": \"Exposure therapy is a behavioral technique used to treat anxiety disorders. It involves gradually and repeatedly exposing a person to the feared object or situation in a safe environment until the anxiety response decreases. For social anxiety, this could involve starting with small steps, like making eye contact with a cashier, and gradually working up to more challenging situations, like attending a social gathering.\"\n    },\n    {\n        \"id\": \"sleep_hygiene_01\",\n        \"content\": \"Good sleep hygiene is crucial for managing anxiety, as poor sleep can exacerbate symptoms. Key practices include maintaining a consistent sleep schedule (going to bed and waking up at the same time, even on weekends), creating a relaxing bedtime routine (e.g., reading a book, taking a warm bath), ensuring your bedroom is dark, quiet, and cool, and avoiding caffeine, alcohol, and large meals close to bedtime.\"\n    },\n    {\n        \"id\": \"avoidance_behavior_01\",\n        \"content\": \"Avoidance is a common behavioral response to anxiety. While avoiding feared situations or objects might provide temporary relief, it reinforces the anxiety in the long term. The brain learns that the avoided situation is indeed dangerous, strengthening the fear. A key part of overcoming anxiety is to gradually reduce avoidance and confront feared situations in a manageable way, a process known as exposure.\"\n    }\n];\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (knowledgeBase);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/knowledgeBase.ts\n");

